import threading
import time
# import exception
import requests
import json
# 模拟并发请求asr接口
def post(num2):
    f=''
    url2 = 'https://test-asr.ke.com/asr_content'
    url1 = 'https://test-asr.ke.com/generator'
    for i in range(num2):
        r1 = requests.get(url1)
        a = json.loads(r1.text)  # 响应内容转换为字典格式
        b = a['data']  # 访问字典中date的值
        c = b['checkcode']  # 访问checkcode的值
        print(c)
        data = {"checkcode": c, "file": f}
        r2 = requests.post(url2, data=json.dumps(data))
        print(r2.text)
def main():
    p2=threading.Thread(target=post,args=(5,))
    p2.start()
if __name__ =='__main__':
        main()

